import React, { useState } from "react";
import "./navigation.css";

function MyButton() {
  const [selected, setSelected] = useState(false);

  function handleOnClicked() {
    setSelected(!selected);
  }

  return (
    <ul style={list_menu}>
      <li style={listyle}>
        <a
          className={`btn-a ${selected ? "change_color" : ""}`}
          href="#"
          onClick={handleOnClicked}
        >
          Home
        </a>
      </li>
      <li style={listyle}>
        <a
          className={`btn-a ${!selected ? "change_color" : ""}`}
          href="#"
          onClick={handleOnClicked}
