          Projects
        </a>
      </li>
      <li style={listyle}>
        <a
          className={`btn-a ${!selected ? "change_color" : ""}`}
          href="#"
          onClick={handleOnClicked}
        >
          Contact
        </a>
      </li>
    </ul>
  );
}

export default MyButton;
